import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import './ClothesPage.css';

const ClothesPage = () => {
  const navigate = useNavigate();

  const featuredClothes = [
    { id: 1, title: 'CLOTHES', image: process.env.PUBLIC_URL + '/images/clothes-rack.jpg' },
    { id: 2, title: 'CLOTHES', image: process.env.PUBLIC_URL + '/images/clothes-rack.jpg' },
    { id: 3, title: 'CLOTHES', image: process.env.PUBLIC_URL + '/images/clothes-rack.jpg' },
    { id: 4, title: 'CLOTHES', image: process.env.PUBLIC_URL + '/images/clothes-rack.jpg' },
    { id: 5, title: 'CLOTHES', image: process.env.PUBLIC_URL + '/images/clothes-rack.jpg' },
    { id: 6, title: 'CLOTHES', image: process.env.PUBLIC_URL + '/images/clothes-rack.jpg' }
  ];

  return (
    <div className="featured-page">
      <nav className="navbar">
        <div className="nav-left">
          <button className="back-button" onClick={() => navigate('/home')}>â€¹</button>
          <ul className="nav-links">
            <li><a href="#clothes">Clothes</a></li>
            <li><a href="#gadgets">Gadgets</a></li>
            <li><a href="#new">New</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#barter">Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button"><FaUser /></button>
        </div>
      </nav>

      <div className="clothes-grid">
        {featuredClothes.map(item => (
          <div key={item.id} className="clothes-card">
            <img src={item.image} alt={item.title} />
            <div className="card-overlay">
              <h2>{item.title}</h2>
              <button className="see-details-btn">See Details</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ClothesPage;
